export const getListAnime=async()=>{
    try {
        const res= await fetch('http://localhost:5000/getAnimeList') 
        return res.json()
    } catch (error) {
        console.error('Error fetching Anime data:', error.message);
    }
}

export const getAnime=async(id)=>{
    try {
        const res=await fetch(`http://localhost:5000/getAnime/${id}`)
        return res.json()
    } catch (error) {
        console.error('Error fetching Anime data:', error.message);
    }
}
